var tipuesearch = {"pages":[{"title":"About","text":"2018 Fall 分組網誌 課程倉儲: https://github.com/mdecourse/2018fall 課程投影片: https://mdecourse.github.io/2018fall/reveal 課程網誌: https://mdecourse.github.io/2018fall/blog","tags":"misc","url":"https://mdecadp2018.github.io/site-40623212/blog/pages/about/"},{"title":"w6","text":"第六週課程 課程 隨機抽查個人倉儲的完整性，以及不斷交代當掉我們的並不是老師而是我們自己。","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623212/blog/2018-Fall-Project-Blog-w6.html"},{"title":"w5","text":"第五週課程 課程 了解未來我們所要進行的小組專題介紹，且用學長所寫的程式來講解機構的配合與其干涉，清楚地描畫出路徑與角度、位置偏差所帶來的不同結果。","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623212/blog/2018-Fall-Project-Blog-w5.html"},{"title":"w4","text":"第四週課程 心得 使用Onshape畫圖時，參照老師所提供的教學投影片使我不懂的英文慢慢地與步驟配合能，讓我對一些英文單字有了相當的認識，對我英文的學習方面很大。","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623212/blog/2018-Fall-Project-Blog-w4.html"},{"title":"w3","text":"第三週課程 中秋節 心得: 沒烤肉，沒月餅。","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623212/blog/2018-Fall-Project-Blog-w3.html"},{"title":"w2","text":"第二週課程 課程目標 說明ShareX的客製化，例如存檔位置能更改至指定資料夾，以及使用放大程式Zoomit來幫助影片拍攝中的部分位置的解析，凸顯其重要度。","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623212/blog/2018-Fall-Project-Blog-w2.html"},{"title":"w1","text":"第一週課程 課程補充 學校就像自助餐廳 老師就是各式各樣的餐點，而學生就是要品嘗這些餐點的客人 我們要多品嘗這些餐點，從這些餐點裡做出自己獨一無二的餐點","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623212/blog/2018-Fall-Project-Blog-w1.html"},{"title":"2018 Fall 分組網誌","text":"2018 Fall 開始將網際內容管理、投影片與網誌進行整合. 課程倉儲 利用 Github 倉儲存放與計算機程式相關的資料, 有幾項好處: 第一, 在不自建網站的情況下, 目前 Github 仍允許免費使用, 管理者除了可以利用網際模式將資料送到對應的 cp github 倉儲 外, 也可以利用近端的 git 客戶端程式, 以分散式版次的流程管理各階段的改版資料. 第二, Github 提供的 Github Pages, 可以讓純 html 加上 Javascript 的網站, 直接在 cp 課程網站 伺服. 第三, 改版後的 CMSimfly, 加上 Pelican 靜態網誌與 Reveal.js 投影片系統, 均為靜態網站資料, 可以直接整合一起, 透過一個網址當作上課參考資料. 該學習哪種程式語言? C/C++、Python、Lua 或 Javascript? 都可以. 在這裡, 學 C/C++ 是為了編寫 Arduino 控制程式, 以及結合 Qt5 建立各種能快速進行工程分析的程式庫, 學習 Python 是為了快速完成 C/C++ 無法迅速完成的分析、模擬與運算, 也能透過 PyQt5 建立視窗程式, 或者呼叫 Flask 建立能在網際環境中執行的協同設計套件. 學習 Lua 是為了能在 V-rep 中使用, 至於 Javascript, 已經無所不在, 尤其在網際成是開發過程, 更是重要, 有其學習的必要性.","tags":"Misc","url":"https://mdecadp2018.github.io/site-40623212/blog/2018-Fall-Project-Blog.html"}]};